(126, 70, 100, 0, 1, 1252, '2023-07-10 03:06:00', 100, 'Tom&apos;s Feedback -Good Candidate\nConfident\nExperience in working with insurance company. No Customer calling\nAlso have some idea about outsourcing. \nRemarks: Good\nOk with night shift\nSiya\'s Feedback -  Good communication skills, confident, lacks a little conviction but immediately picked it up when she was informed so, basic understanding of sales is okay, very good introduction of sales, I would rate her 8/10 considering that she is fresher and also the situation was on the spot given. Also, she is a quick learner.', '2022-10-19 03:10:22'),
(127, 69, 100, -1, 1, 1252, '2022-10-19 03:08:38', 100, 'Tom\'s Feedback - Good Candidate\r\nConfident\r\n. No Customer calling\r\nAlso have some idea about outsourcing. \r\nRemarks: Good\r\nOk with night shift\r\nSiya\'s Feedback - Good communication skills, willing to learn, confident, needs training on sales modules, willing to work on her flaws, conviction in the way she speaks , salary negotiated to 10K, asked her to sell me a product and I would rate her 8/10 considering that she is a fresher, and also the situation was on the spot given', '2022-10-19 03:08:38'),
(128, 70, 100, -1, 1, 1251, '2022-10-19 13:09:12', 500, 'Interview feedback\r\n\r\n- College pass out. Fresher. Can join full time. OK with sales target.\r\n- Communication: Good\r\n- Approach: Good\r\n- Confident on what she says: OK\r\n- She has insurance experience\r\n- Wanted me to convince for a meeting. Sounds little chipkoo :D\r\n . But not that bad\r\n- When you drop a lead: Reasons mostly OK\r\n-  How to handle the failure of an employee get hired by the client: Approach was good\r\n- Reason of leaving insurance sector: OK\r\n- Lead generation: Mentioned few approaches. They are basic as she has no exposure to IT sales, can be improved by us. \r\nOverall: Good\r\nDecision: Hired', '2022-10-19 13:09:12'),
