mp; development of web site\nPublished site and uploading to server\nParticipated in client meetings\nHandling major modules and written what are the reusable modules need in this project\nIntegrated Braintree payment gateway integration\nDeveloped web hook for Braintree payment gateway transaction information management\nDeveloped restrict modules based on roles and permissions module\n\nClient: AOTG\n\nProject: Avail on the Go\n\n\n463550539750\nAvail on the Go project mainly developed for body building workout sector. In this project there are three types of users: Admin, Trainer and Client. Each user has their own functionality and trainers can access client membership.\n\nTechnical Environment: Angular, Node_rDOTrjs, Express_rDOTrjs, Passport_rDOTrjs, AJAX, JQuery, CSS3, Bootstrap, HTML5, MySQL.\n\nRoles _rANDramp; Responsibilities:\nWorked on Social login integrations\nImplemented dashboard and widgets functionality as per the requirements\nWorked on payment gate way integration\nHandling version controller (GIT Lab)\nAchieved the functionality that supports Cross Browsers\nDeveloped the Node_rDOTrjs base framework which includes authentication using Passport_rDOTrjs\nWorked on subscription module functionality\nWorked on Braintree Payment gateway integration and web hook action functionality\nWorked on Cron functionality for users recurring payment methods\nDeveloped restrict modules based on roles and permissions module\n\nClient: Chrysalis\n\nProject: Chrysalis Web Portal\n\nThe primary idea behind Chrysalis business originated around the fact that people buy new costumes for various events and end up overpaying for them. These costumes are seldom used multiple times and end up in the closet, storage or eventually being discarded. However, the carbon impact of these costumes is very high on the environment. Hence, setting up an online marketplace-based exchange model will help in solving this problem, allowing users to search and look up costumes that have been used, and can buy them at more reasonable prices.\nThe project requires development of an online marketplace for used costumes that will allow sellers to list their costumes online and buyers to browse and buy these costumes. There will also be the ability for sellers to send their costumes in bulk to Chrysalis and get paid for them.\nThe project also holds a social welfare importance as well, as costumes which cannot be sold on the site will be given out to charity to raise funds. Every seller/buyer also has the option to contribute their way into some of these charities to help them raise funds. Additionally, for Phase 1, a simple mobile app will be needed, primarily for sellers to be able to take pictures of their costumes and post them on the site.\n\nTechnical Environment: ReactJs, Node_rDOTrjs, Express_rDOTrjs, Passport_rDOTrjs, AJAX, JQuery, CSS3, Bootstrap, HTML5, MySQL.\n\nRoles _rANDramp; Responsibilities:\nRequirement analysis, design _rANDramp; development of web site.\nPublished site and uploading to server.\nParticipated in client meetings.\nHandling major modules and written what are the reusable modules need in this project\nHandling version controller(GIT Lab)\nHandled modules like Message Broadcast, Roles, and Role Permissions.\n46355045085Handled Shipping method module and used USPS and FedEx methods\nDeveloped wallet module using with Stipe payment gateway\nIntegrated Stripe payment gateway integration\nDeveloped web hook for stripe payment gateway transaction information management\nWorked on advanced search functionality for products\nDeveloped on Google address pointer map integration\nDeveloped restrict modules based on roles and permissions module\nDeveloped admin panel for maintain all modules\nWorked on Checkout process\n\nClient: iVANZiPOP\n\nProject: iVANZiPOP Web Portal\n\nThis project involves creating a Retail Subleasing listing web portal for retailers to list a retail-share space for a sublease increment of days, weeks or months. The portal will be a meeting place for independent vendors who are looking to sub-lease dedicated spaces in which to showcase their products. These vendors will be able to rent space in a retailers store and arrange rental payments via the web portal. In addition to showing listings, this portal will facilitate a sub-lease application and review process for rental closings. Users will communicate about listings of interest via an internal messaging system.\nAs a secondary function, the web portal will allow Retail Agents to create user accounts and listings. These listings will not have an online booking process, but will allow users to make contact with agents by filling out a contact form and communicating with them via internal messaging system. All bookings and financial arrangements will be facilitated outside the purview of the system.\n\nTechnical Environment: ReactJs, Node_rDOTrjs, Express_rDOTrjs, JQuery, Sendgrid, CSS3, Bootstrap, HTML5, MySQL\n\nRoles _rANDramp; Responsibilities:\nRequirement analysis, design _rANDramp; development of web site\nPublished site and uploading to server\nParticipated in client meetings\nHandling version controller (GIT Lab)\nWorked on advanced search with optimised query\nTaking technical classes to team members\nWorked on advanced search functionality for products\nDeveloped on Google address pointer map integration\nDeveloped restrict modules based on roles and permissions module\nWorked on booking spaces module', '2022-09-23 01:18:18', '2022-09-23 01:18:18', 0, 'site_1/0xxx/e7a5bd994b7da4bd7aa4203f3b9a0f01/', 'c7a05f053d9f0b7216af9234175f9135', 21, 'ab8649203871def0836a5ae76fa87ce5'),
