ach other application.\n\nEnvironment:\nCore Java, HTML, java Script, CSS, Spring, Hibernate , restful web service, MySQL Server, Tomcat, Maven.', '2022-10-26 00:21:32', '2022-10-26 00:21:32', 0, 'site_1/0xxx/39b55e46334cf0fcf345c20e6573e371/', 'ed58e65c429b9a9e972392689400cea3', 22, 'a427b8eb9a8834b19250c13a356358de'),
