 in Plano. This site is their venture to capture e-commerce market. They used wide range of technologies here like Oracle ATG Commerce, Spring, Spring Batch, Endeca, Unit testing frameworks like Mockito, Junit etc_rDOTr,\n\nResponsibility:\nAs a developer my responsibilities include,\n\nDeveloping batch jobs, which generate xml by fetching data from DB which in-turn is used by Endeca for indexing.\nDeveloped department, navigation and search pages using spring rest controllers and jsp.\nDeveloped custom tags to generate sort, pagination and pdp urls.\nImplemented caching mechanism for caching rest responses using Hazelcast cache.\nCreated rest resources using spring rest to expose endeca indexed data.\nCreated custom pojo classes to populate required data returned from endeca which can be used to build up the pages and expose the same to mobile.\nCreated test cases using Mockito, Junit.\nInvolved in defect reporting, tracking and fixing. \nInvolved in bug fixing.', '2022-10-26 00:26:29', '2022-10-26 00:26:29', 0, 'site_1/0xxx/672c5ee047ac2718dd9d4337ff87cf87/', '4e12a0416a542f5b65960a512eb5ec6b', 18, '7518b581abfae499c9e6a410dc5d1e4e'),
