ting functionalities using design pattern oriented architecture includes Controller, Service and DAO layers.\nCoding and debugging by using debugging tool and Log4j.\nMaven used for Project Management Structure.\nUsed GIT for code repository and as version control mechanism.\nObject Creation and injection was done using Spring IOC mechanisms.\nPerformed Debugging and testing using Test cases.', '2023-01-16 01:04:43', '2023-01-16 01:04:43', 0, 'site_1/0xxx/bd96458aceaee026acde637e125db088/', 'a27f227296d77f45efcf1529eeccd943', 26, 'f28522c327392d2dbb513a2fadb2d3de'),
