livered in the US. This includes the google api integration where we plot the values on the United states map. \nThe day to day scanned and mailed percentages are plotted and shown after the user uploads data via excel. \nProject _rPOUNDr3s: \nName : Vet24seven \nTeam Size : 5 members \nExperience - June 2018 to May 2019\nTechnologies : HTML5, CSS3, Javascript, Angular, Bootstrap \nURL : www_rDOTrvet24seven_rDOTrcom \nDescription: \nVet24seven is an app for Web Devices where you consult with your veterinarian, and provides animal owners with veterinary consultations via their mobile device from veterinarians and veterinary practices in vet24seven Network. Vet24seven will bring veterinarians directly to clients via the more than 1_rDOTr5 Billion smart devices worldwide. It will be available as a website and app across all platforms. \nPERSONAL PROFILE \nGender : Male \nNationality : Indian \nLanguage Known : English, Hindi _rANDramp; Telugu \nStrengths : Hardworking, Confident _rANDramp; Adaptable Nature \nDECLARATION \nI hereby declare that the above-written particulars are true to the best of my knowledge and belief', '2023-01-17 01:38:56', '2023-01-17 01:38:56', 0, 'site_1/0xxx/4442e5174ecb741e489e4019f4afe1a0/', '84b27471cfc2cf61c3e68253f27f8660', 14, 'bc7c4adb8ea9057b4c2ce9d211646603'),
