s. Now Job Poste is visible to candidates. They can able to apply the job. After that recruiter will receives the candidates applications and he will review and shortlist it. In phone screening enter the details about candidate and person who conducting the interview.            \nRecruiter can able to post the Job based on requirements.\nRecruiter should take the Approve from Approvers\nResponsibilities\nInvolved in Spring Controllers development \nImplemented backend and front-end Validations\nWorked with jQuery Ajax calls to communicate with Rest Services.\nDeveloped Hibernate mappings using annotations\nDeveloped DAOs using HQL and Criteria API\nDeveloped JSPs as per the Requirement\nDone unit testing and integration testing.\nEnvironment\nTechnologies: Spring MVC, Spring ORM, Spring IOC, Hibernate, Web Services\nTools : Eclipse, LOG4J, MAVEN, SVN, Junit, Mockito.\nApp Server : Tomcat\nData Base : Oracle 10g\nWeb Design : HTML, CSS, jQuery, AJAX.\n\n \nPersonal Details\n\n           Name: k. Sreedhar\n           Father Name                   : k. Venkatesh Reddy\n           Marital Status           :  Single\n           Nationality:  Indian\n           Date of birth:  25-04-1996.\n           Languages known           :  English and Telugu.\n\nDeclaration\n\nI hereby declare that the above information is true and correct to the best of my knowledge.\n\n\n\n\n                                                                                                                                  (Sreedhar. K)', '2023-01-18 00:15:54', '2023-01-18 00:15:54', 0, 'site_1/0xxx/3ccff295f60a9eb14e6cd2947f6d8aa8/', '6f1bc6a7e5d8038796edb8bb48a3e6bf', 34, '37920e41f3b0bb999b24dff73decb859'),
