s with MVVM architecture.\nDeveloping code to make API calls using javascript\nInteracting with Business Analysts and Developers in identifying the requirements and designing and implementing the Screens.\nEstimating story points for each component\nCreated separate front end components in storybook and integrated components into AEM \nSoftware Tools\nVisual Studio Code\nEnvironment\nReact JS, Javascript, jQuery,JSON API, GIT, Sourcetree\n\n\nProject _rPOUNDr3\nProject\nHPE Technomics Application (Xamarin IOS Mobile Application)\nCustomer\nHewlett _rANDramp; Packard, UK\nPeriod\nDec 2018 to till date\nProject description\nTechnomics Application is a new mobile application developed to check the existing deals, generate finance quotes for credit. This application also has ability to download the generated quotes in the form of pdfs. This application is developed to support a web application which is used for same purpose of creating credit applications and generating quotes.\n\nRole\nDeveloper\nResponsibilities\nDeveloping screens with Xamarin IOS with views and storyboard.\nDeveloping applications with Models, Viewcontroller architecture.\nDeveloping code to make API calls\nInteracting with Business Analysts and Developers in identifying the requirements and designing and implementing the Screens.\nDeveloped and Optimized the API calling architecture\nCreated apple developer certificates to provisioning profiles\nPushed application to Apple store using Application loader\nSoftware Tools\nVisual Studio 2017\nEnvironment\nXamarin iOS, C_rPOUNDr, JSON API, GIT, Sourcetree\n\nProject _rPOUNDr4\nProject\nRemote Connect Tool (ASP_rDOTrNET MVC Web Application)\nCustomer\nXerox Corp, UK\nPeriod\nMar 2017 to Oct 2018\nProject description\nRemote Connect Tool is a new application developed to maintain data related to Supplies, Meters and Connectivity of Xerox machines and added the new features to generate reports and optimized the report performance. Remote Connect tool aids