nt Gathering with various Product Owners and Business\nAnalysts.\no Estimating the efforts based on Analysis to develop the user requirements.\no Written code in MVC and C_rPOUNDr to develop the user requirements.\no Implemented Database related activities by using ADO_rDOTrNET Entity Framework\nand LINQ to connect retrieve and update the data from SQL Server.\no Involved in Database tables design, Written SQL Queries, Views, Stored\nprocedures for Data retrieval from the Database.\no Scheduled the Jobs using ASG Zena.\no Involved in Preparing the various documents like Design, Test cases and\nRelease.\no Involved in Unit and Testing and Fixed the defects in every build release\nraised by users.\no Involved in Daily Status meetings for updating the status of the development.\no Maintained version control by using Microsoft Team Foundation Server (TFS).\no Involved in Deployment activities by using TFS.\nApplication 2: CTS (Contractor Timekeeping System)\nCTS Tracks contractor costs against Maximo Purchase Orders and Work Orders.\nAllocations go through a work-flow process of Contractor Approver 1, Contractor\nApprover 2, Exception log (optional, if something on the timecard if outside of normal\nconditions), and ADM Approver. Once all approvals are obtained for a timecard, invoices\nare generated for the vendor and pushed to Maximo for invoice approval.\nResponsibilities:\no Providing Development and Support to application CTS.\no Expertise in providing immediate solution for high priority issues and\nshowstopper issues.\no Experience on handling ticketing tool Service Now.\no Involved in Daily Status meetings for updating the status of the ticket status.\no Involved in MIM calls in case of Priority one tickets which needs to be\naddressed with in four hours.\no Maintained version control by using Microsoft Team Foundation Server (TFS).\nProject _rPOUNDr2\n\nProject Name : Apollo Med Mantra\nRole : Support Analyst\nClient : Apollo Hospitals India.\nDuration : May 2017  June 2019.\nEnvironment : ASP_rDOTrNet Web forms, HTML, CSS, JavaScript.\nDatabase : SQL server 2008\nDescription:\nMed Mantra is a comprehensive array of clinical, patient care, administrative and\nsupport service functionalities. The system has matured over years through the\nprocess of implementation at several hospitals and is under continuous development\nand enrichment path in pursuit of excellence. Med Mantra offers workflows reflecting\nbest practices in the industry. It is developed on robust architectural design and\nlatest software platforms to produce an advanced information processing, storage\nand retrieval system.\nThe application_rANDramp;_rPOUNDr39;s rich administrative and clinical functionality along with the in-built\nInterface Engine to communicate with other applications/devices in an integrated\nenvironment, will meet the business requirements. The application is compliant to\ninternationally approved Healthcare standards like HL7, DICOM, ASTM, LONIC,\nICD10 and CPT4.\nTCS is providing L3 level support to Apollo hospitals across India, Including minor\nand major enhancements also.\nResponsibilities:\no Providing Technical Support activities to Apollo Med Mantra an application\nused by all Apollo hospitals in India.\no Application contains 14 modules, I used to deal Billing and Crm modules.\no Billing is the most sensitive module in the whole application, which is\ninternally connected with all other modules\no Experience in handling ticketing tool Equator which the apollo team used to\nraise their issues.\no Maintained version control by using Microsoft Team Foundation Server (TFS).\no Involved in Weekly Status calls for updating the status of the ticket status.\no Involved in crucial Production support at Different Deployments and\nimplementation/live in new locations. Worked continuously 14-16 hours\nduring live. Worked on Complete night shift during deployments.\no Requirement Analysis\no Implementing / Adding New Features based on requirement / change.\no Implemented GST billing in Apollo Hospitals in all locations.\no Integrated PAYTM billing and A new feature LOYALTY CARD for all locations\nusing API.\no Developed user test cases _rANDramp;amp; Involved in User Acceptance testing.\nProject _rPOUNDr3\n\nProject Name : HCG HIS Implementation\nRole : DB Programmer\nClient : HealthCare Global Enterprises Ltd (HCG)\nDuration : Jan 2016  April 2017\nEnvironment : SQL server 2008\nDescription:\nHealthCare Global Enterprises Ltd (HCG), Indias largest provider of cancer care is\nat the forefront of the battle against cancer. It is network of over 26 comprehensives\ncancer centers spread across India.\nTCS is providing Development and Support to HCG hospitals, The project is to\nintegrate a new modules Pharmacy and Mis reports to the existing application.\nResponsibilities:\no Involved in Database tables design, Views, Written SQL Queries for Data\nretrieval from the Database.\no Written stored procedures using SQL in SQL SERVER 2008.\no Developing different queries which are useful for MIS Reports and Audit\nI hereby declare that all the information furnished above is true to the best of my\nknowledge.\nPlace: Hyderabad', '2023-03-20 07:43:14', '2023-03-20 07:43:14', 0, 'site_1/0xxx/9b421f2cf9fe61fadd470e542f44726d/', '4a80239ab945bb4ce19c5e938acb22b0', 55, '6af731a50380dcef7af192d96d294b2d'),
