(343, 346, 100, 1, 'Naukri_Yokeshwaran[5y_11m]', 'Naukri_Yokeshwaran[5y_11m].docx', 'Naukri_Yokeshwaran[5y_11m].docx', '', 1, 'YOKESHWARAN E S\n                                          Email:esyokesh_rATrgmail_rDOTrcom                                                                                                         Mobile:   88831 23205\n                                                                                                                                                                                            \n\n\nOBJECTIVE\n\n                      Seeking a challenging and rewarding career in Information Technology, where I can contribute my knowledge and skills for the growth and development of the organization and be able to implement solutions that meet the customer requirements using my technical skills.\n\nSUMMARY\n\nI have around 6 years of experience in IT as a Software Developer. This spans across analysis and development phases of the software development life cycle.\nExpertise in C_rPOUNDr, VB _rDOTrNet technologies WinForms, SQL Server and Crystal Reports.\nAbility to work in challenging environments.\nExcellent understanding of Software Development Life Cycle (SDLC), Agile methodology, Waterfall model ranging from requirements gathering to UAT.\nAn effective communicator with strong team management, leadership and analytical skills.\nBasic knowledge on GIT, IIS.\nGood Domain knowledge in the Retail Business sector.\nHands on experience in implementation of application and giving end user training,\nDeployed in different client places for implementation and giving product training, bug fixing and other support activities.\n\nEDUCATIONAL QUALIFICATION\nB_rDOTrE (Computer Science) from Maharaja Engineering College, Coimbatore in 2013.\nHSC from Sri Vijay Vidyalaya Boys Matriculation Hr. Sec. School, Dharmapuri in 2009.\nSSLC from Senthil Matriculation Hr. Sec. School, Dharmapuri   in 2007.\n\nTECHNICAL SKILL SET\n\nProgramming Languages:  VB_rDOTrNet, C_rPOUNDr.\nUI Technologies: Win Forms.\nIDE Tools: Visual Studio 2012/2010/2008/2005, SQL Server Management Studio.\nDatabases: MS SQL SERVER 2016,2012/2008 R2/2008/2005.\nReporting Tools: Crystal Reports 8_rDOTr5.\nServers: Windows Server 2022,2019, 2016, 2012, Windows Server 2008 R2, IIS 7_rDOTr5/7_rDOTr0/6.\n\nPROFESSIONAL EXPERIENCE\nWorking as a Senior Software Developer in Utthunga Technologies Pvt Ltd from Dec 2022 to Feb 2023.\nWorked as a Senior Software Developer in Team ware solutions [Payroll] TCS, Chennai from Feb 2022 to May 2022.\nWorked as a Software Developer in GIRI TECHNOLOGIES PVT LTD, Chennai from March 2014 to July 2019.\n\nPROJECT DETAILS\n\nProject _rPOUNDr1                          :             ITD DEVICE  MOBILITY APPLICATION[Dec 2022 to Feb 2023]\n\nCLIENT: Rockwell Automation\nLanguage: C_rPOUNDr _rDOTrNet, JSON\nDatabase Tool:MS SQL Server\nRole:             Software Developer \nProject Description:\n\nData exchange mechanism between mobile device and ITD via Wi-Fi network over Ethernet/IP which leverage Rockwells Digital services. Re-use the angular front end which cover overview and parameter list\npages. Develop JavaScript and C_rPOUNDr API bridge which allows to call functions from JavaScript to C_rPOUNDr \nand vice versa.\n\n\nProject _rPOUNDr2                          :             PROPERTY MANAGEMENT SYSTEM [Feb 2022 to May 2022]\n\nCLIENT:AIMCO Properties\n\nLanguage: C_rPOUNDr _rDOTrNet (Console)\nDatabase Tool:MS SQL Server\nRole:             Software Developer\nProject Description:\n          This was a property management system where source was RealPage vendor and my role was ETL developer where I maintain SSIS packages and SSIS jobs with help of additional Microsoft technologies such as Dot net and SQL server.\n\n\nProject _rPOUNDr3:  AKSHAYA RETAIL JEWELLERY [Sep2017-July-2019]\nCLIENT: NAC JEWELLERS, CHENNAI\n\nLanguage: Vb_rDOTrNet (WinForms, Crystal Reports)\nDatabase Tool: MS SQL Server\nRole:  Software Developer\n\nProject Description:\n          Akshaya Retail Jewellery is a windows-based Billing application. It helps the NAC Jewellers to automate the billing process both at Corporate and Retail offices. Using this application helps the user to keep track of the sales and purchase details of products at each retail store and generate reports for daily, weekly, monthly, annually which will help the users to plan for the raw material procurement.\n\n\n\n\nProject _rPOUNDr4:  AKSHAYA RETAIL SAVINGS [Aug 2016-Aug 2017]\nCLIENT: NAC JEWELLERS, CHENNAI\n\nLanguage: Vb_rDOTrNet (WinForms, Crystal Reports)\nDatabase Tool: MS SQL Server\nRole:  Software Developer\n\nProject Description:\nAkshaya Retail Savings is a chit-based windows desktop application. Using the application, users can add New Members to Chit scheme, monthly savings have been done.  This is used to generate various reports like new member list, monthly reports, paid and unpaid, rejoin and non-rejoin list, non-closure report. After matured or unmatured chit they can buy products in the store for paid installment.\n\nProject _rPOUNDr5:      CATALOG AND ONLINE MODULE [May 2015-July 2016]\nCLIENT:       NAC JEWELLERS, CHENNAI\n\nLanguage:       Vb _rDOTrNet (WinForms, Crystal Reports)\nDatabase Tool:       MS SQL Server\nRole:       Software Developer\nProject Description:\nCatalog and Online Module application helps the NAC Jewellers to sell their products online. Using this application, admin users will store the product type, design style and price of a particular Jewelry are stored in the Cloud databases. NACs web application will use the data stored on the cloud databases to sell their products to their customer groups.\n\nProject _rPOUNDr6              :      AKSHAYA RETAIL FOR  TEXTILES [May 2014 - April 2015]  \nCLIENT:     SARAVANA STORES, CHENNAI\n\nLanguage:      Vb _rDOTrNet (WinForms, Crystal Reports)\nDatabase Tool:      MS SQL Server\nRole:      Software Developer\n\nAkshaya Retail is a collection of windows-based applications which captures the complete management of purchase, warehouse, and sales (stock, sales, claims and schemes). I have done production support and gave training to users. Resolving issues in the project.\n \n\nResponsibilities:\n\nUnderstand the Client Requirements, Business Specification, Domain Knowledge thoroughly and analyzing the same.\nInvolved in designing the user interface using WinForms.\nAltering\\Modifying Design or queries both application and SQL (Store procedure, tables, triggers, views).\nInvolved in Build installation and executing the DB scripts, Import and Export from Excel to database, tables, records and vice versa.\nEnhancements in the code for additional functionalities in the application.\nAdd permanent fixes to reduce issues and to make system stability.\nMaintenance plan, Schedule Jobs, Performance tuning has been done in SQL Server.\nGood Analytical, Debugging _rANDramp; Problem-solvingskills.\nUnit and manual testing for each and every module which has been developed. \nAuto backup, Auto shrink, database maintenance backup recovery.\nInvolved in Bug fixes and Preparation of System Support Guide, Job level documentation and Root Cause Analysis.\nInternet Information Service manager and browser compatibility work has been done.\nPersonal Details\n\nFathers Name\n: S. Elangovan\nDate of Birth\n: 13  July  1992\nMarital Status\n: Single \nLanguages Known\n: English _rANDramp; Tamil\nAddress\n:1/145A, Collectorate Po, Oddapatti\n\n  Dharmapuri-636705\nPassport No\n: U8979180[30/12/2030]', '2023-03-21 02:50:26', '2023-03-21 02:50:26', 0, 'site_1/0xxx/3c987bf628ada034b59e7f3acb500a6b/', '6835d60a0c9afb0ee6d3fe257013eaac', 23, '73eea3dceee78f02f92f6178d51e47fb'),
