(348, 351, 100, 1, 'Naukri_SandeepVankadari[8y_0m]', 'Naukri_SandeepVankadari[8y_0m].docx', 'Naukri_SandeepVankadari[8y_0m].docx', '', 1, 'Sandeep Vankadari7396629460\nSandeepvnk_rATrgmail_rDOTrcom\n\nObjective:\nTo obtain a _rDOTrNet Developer position that challenges my related experience and encourages professional growth.\n\nProfessional Summary:\n8_rDOTr6 years of professional experience in development of Web Applications using Microsoft Technologies.\nHands on experience in Microsoft Technologies, Databases, C_rPOUNDr, Asp_rDOTrNet and Asp_rDOTrNet MVC\nHands on in Application Development with ASP_rDOTrNet, ADO_rDOTrNet, Sql Server-2005,2008,LINQ,JQuery, EDM((Entity Data Model)\nHands on in MVC with EDM(Entity Data Model)\nHands on in LINQ, EDM\nHands on in JQuery, AJAX\nExperience in writing Stored Procedures using MS-SQL Server\nQuick learner with the ability to grasp new technologies.\nPossess good communication skills, self-motivated, pro-active, task oriented, good team player, and quick learn at new technologies and systems.\n\nTechnical Skills _rANDramp; Knowledge:\n\nTools\nName of Tools\nWeb Application Framework\nASP_rDOTrNet _rANDramp; ASP_rDOTrNet MVC\nProgramming Language\nC_rPOUNDr _rDOTrNET\nDatabases\nMS -SQL Server\nData Access Technologies\nADO_rDOTrNet , LINQ, Entity Framework\nWeb Technologies\nJQuery ,AJAX,AngularJS, Typescript,Angular 5,6 and 11\nDevelopment Tools\nVisual Studio _rDOTrNET 2010/2012/2013\nMS Services\nWCF ,WebAPI\n\nEmployers\nWorking as Lead Analyst in CGI from February 2021 to Present\nWorked as Consultant in Deloitte Consulting India Private Limited from April 2017 to December 2020\nWorked as Analyst(System Development) in Verizon Data Services India from     January 2017 to April 2017\nWorked as Software Engineer in Thomson Reuters International Services private limited from August 2016  to January 2017\nWorked as Trainee Software Engineer in JNET Technologies from April2015 to August2016\nWorked as Trainee in People Tech Group from April 2014 to April 2015\n\nProject  1:\nTitle:Digital and Contact Center Technology Support\nClient:CIBC\nEnvironment:ASP_rDOTrNET ,Angular 11\nTeam Size:8\nDuration:Feb2021 to Present\n\nPROJECT DESCRIPTION:\n\nTelAgent, Simplii are monolithic applications used by agents for doing transfers between accounts. It also allows agent to view Transaction History for accounts, Registered Billers etc.\n\nROLES AND RESPONSIBILITES:\n\nInvolved in enhancements, development, bug fixing _rANDramp; unit testing.\nInvolved in preparing application design document for the requirements.\nInvolved in production issue fixing.\nWorking on Angular POC for migration of application\n\nProject  2:\nTitle:KENTUCKY HEALTH BENEFIT EXCHANGE\nClient:KENTUCKY CABINET FOR HEALTH AND FAMILY SERVICES\nEnvironment:ASP_rDOTrNET MVC, Angular 6\nTeam Size:10\nDuration:April 2017 to December 2020\n\nPROJECT DESCRIPTION:\n\nIt is an Waiver application in which it provide medical facility services to physically disabled persons based on their income. In order to register for these services they need to provide their disability certificates for registration. By these certificates Kentucky state officials verify their certificates and approve services for them\n\nROLES AND RESPONSIBILITES:\n\nWorked on ASP_rDOTrNet MVC controllers and views \nImplemented diagnosis page functionality in which users provide their medical certificates in the screen\nInvolved in writing stored procedures for the desired functionality\nInvolved in data fixes for the defects raised by client\n\n\nProject  3:\nTitle:EFiler\nClient:Australia Tax Office(ATO)\nEnvironment:ASP_rDOTrNET WebAPI,Typescript Angular4\nTeam Size:6\nDuration:August 2016 to January 2017\n\nPROJECT DESCRIPTION:\n\nIt is an EFiling application in which users can be able to EFile their taxes such as Direct and InDirect taxes example are VAT,SalesTax,Company Tax etc_rDOTrIn application we have 4 tabs such as Queued,InProgress,Failed,Historytabs_rDOTrUser need to import file then it goes to Queued tab then he need to validate the imported record after that it goes to InProgress tab and later based on response from ATO it get status such as passed or failed and next next he will efile the imported record\n\nROLES AND RESPONSIBILITES:\n\nImplemented WebAPI services for getting XML request and response from DB\nImplemented displaying XML request and response using typescript angularjs\nInvolved in fixing bugs\n\nProject  4:\nTitle:Montgomery County Election Night Results\nClient:PCC Technology Group\nEnvironment:ASP_rDOTrNet MVC, SQL Server,Angular4\nTeam Size:3\nDuration:September 2015 to August 2016 \n\nPROJECT DESCRIPTION:\n\nIt is an election results application in which users can be able to see the election results for the county_rDOTrHere user can be able to see the results for different offices such as Statewide,Countywide,District wide based on election and he can be able to download the results report to excel and csv.\n\n\n\nROLES AND RESPONSIBILITES:\nDid Angular JS for displaying the results through JSON files which we get from Services\nImplemented pagination for all the pages\nDid export to excel and csv for all tabs\nImplemented search functionality through angularjs\n\n\nProject  5:\nTitle:Vermont Electionet Administration System\nClient:PCC Technology Group\nEnvironment:ASP_rDOTrNet MVC, MYSql,Ajax,Jquery\nTeam Size:5\nDuration:3 months\n\nPROJECT DESCRIPTION:\n\nIt is an election application in which state and town user can register the voters online,add streets for election,maintainvoters,addelection,addballot,add election results and release results through application \n\nROLES AND RESPONSIBILITES:\nDid Jquery validations.\nImplemented Partial views for election and party information pages.\nImplemented Stored procedures for some modules.\nImplemented email functionality for state and town user logins\n\nPROJECT - 6:\nTitle:Procurement App\nClient:PeopleTechGroup\nEnvironment:WebAPI,Angula