rnover, Compensation attractions, Training, Grievance and other administrative aspects.\nGood networking with 3rd parties in implementing welfare schemes in organization.\nExpertise in attendance and payroll Management.\nExpertise in function arrangements in organization on CSR occasions like womens day, May day, republic day, independence day, \n\n\nPROFESSIONAL EXPERIENCE\n\n14th Dec 2015 - Till Date | HR Analyst | Pokarna Engineered Stone Limited\nKey Result Areas:\nLeading talent acquisition activities.\nManaging the mass onboarding process in broad manner.\nAnalysis of Employee Turnover, welfare schemes, Administration and other employee engagement survey  for improvements.\nDriving specific engagement initiatives to maximise productivity and develop high engaged teams.\nWorking with line managers and employees to address all types of employee relation aspects.\nManaging data updates on master employee data, and personal employees file management and updation.\nManaging exit interviews, separation clearance, full and final settlement.\nArrangement of railway/flight/bus tickets,accomodations of the on duty going employees.\nEnsuring the smooth functioning and administration of canteen, guest services, transportation, housekeeping and Dispensary Management at OHC\nConducting various cultural and sports functions on May Day, Independence day _rANDramp; Republic day, Womens day.\nImplementation of welfare schemes, and 5S.\nMonitoring of Housekeeping activities.\n\n15th Nov 2014 - 6th Dec 2015 | HR Associate | SLC Projects Pvt. Ltd_rDOTr, Visakhapatnam\nKey Result Areas:\n\nOnboarding-Getting mail id created,sharing it with candidates.\nDisengaging the employee on HRIS.\nUpdating onboard checklist and making dashboards on onboarding, resignations and disengagements.\nPreparing id cards for new employees,and visitors.\n\nManaging ESI and group Mediclaim databases.\n\n1st Aug 2014 - 6th Nov 2014| Trainee HR Officer | Brandix Apparel India Pvt. Ltd_rDOTr, Visakhapatnam\nKey Result Areas:\nInitiated a drive to draw attention to the importance of education amongst the children of Brandix employees.\nAnalysis of welfare schemes, transportation and attrition rates for improvements.\nAssisted the management in organizing the categories of competitions like Singing Star to recognize the best singers working at Brandix, Dancing Star which is a team-based event and Announcing Star.\n\nACADEMIC INTERNSHIP \n\n20th Jan 2014  29th Mar 2014| Trainee| Jindal Steel and Power Limited, Angul, Odisha\n\nProject: Study of Training and Post Training Effectiveness\nUsed Kirkpatricks Model of Evaluation to determine the skill gap, behavior change and the contribution of the employees that affect the organization\'s performance\n\n6th May  20th Jun 2013 | Intern| Lakshmi Hyundai Automobiles, Visakhapatnam\n\nDone project on Lean Management based on the Research Model.\n\n20th Dec 2011  25th Mar 2012 | Kinematic Synthesis and Development of Hand Driven Rice Transplanter\n\nUsed Autocad and CATIA to design handheld rice transplater which helped farmers.\n\n9th May 2011  28th May 2011 |Intern| Rastriya Ispat Nigam Limited, Visakhapatnam\n\nStudy on compacting and binding machine and how to convert steel from long to short length with proper tacking.\n    \nACHIEVEMENTS\n\nInitiated Employee referral scheme in Pokarna which helped in generating more talent pool, and fast selections.\nInitiated and organized various games in May day week to increase employee engagement in Pokarna in year 2022. \nAssisted management in implementing 5 years service and 10 years service awards in Pokarna in year 2019.\nAssisted management in reducing attrition rates in Brandix in 2014. \nImplementation of Kirkpatricks model evaluation in Brandix in 2014.\n\nWORKSHOPS \n\nAttended lecture Series on \"The philosophy of Bhagvad Gita\", 2013, Gitam Institute of Management, Visakhapatnam\nParticipated in \"United Nations International Year of Youth\", 2011, Gayatri Vidya Parishad 