(431, 434, 100, 1, 'Naukri_CHINMAYEED[4y_1m]', 'Naukri_CHINMAYEED[4y_1m].docx', 'Naukri_CHINMAYEED[4y_1m].docx', '', 1, 'RESUME\nCHINMAYEE D\nChinmayeed16_rATrgmail_rDOTrcom\nCell :9658534144\nOBJECTIVES:\nI am dedicated hardworking team player with experience and excellent knowledge on cutting edge up-to-date web development Technologies , React Native, Angular, Node Js, Express Js , Mongo DB seeking a web developer role in your company. I am willing to utilize the  2_rDOTr9 years of Development experience as an UI Developer and Good analysis skills and 1_rDOTr4 years of Manual Test Engineer for your company achieve its goals.\nPROFESSIONAL  SUMMARY:\n2_rDOTr9 years of development experience in User Interface applications and integration of highly transactional and scalable applications using Angular, Mongo Db, React Native.\n8 months Good Experience as a Mobile Developer in React Native\n1_rDOTr4 years of Manual Testing Experience\nBuilding Web User Interface (UI) usingHTML/HTML5,CSS/CSS3andJavaScript, jQuerythat follows W3C Web Standards and are browser compatible.\nGood Experience with Responsive Web Design (RWD) technologies likeAngularJS, jQuery, Node_rDOTrjs, Bootstrap, HTML, XHTML, CSS, JavaScript, AJAXandJSON.\nExperience in working on modern full stack JavaScript environment likeMEAN (Mongo, Express, Angular, Node)\nExperience in working withRESTful Web Servicesand implementingRESTful API\'s.\nExperience of working on CSS Pre - processors like LESS and SASS .\nExperience in taking performance optimization measures for website/web applications to reduce the response times and hence enhancing the end user experience.\nGood experience in writing back-endSQL queries for fetching data and Analyse the Issue.\nQuick learner and proficient in solving the technical issues in the project.\nFollowedAgile/Scrum methodologyof software development, which satisfies the customer through early and continuous delivery of valuable software.\nTECHNICAL SKILLS:\nWeb Technologies: React Native, HTML4/ HTML5, CSS3, JavaScript, jQuery, Bootstrap, Angular_rDOTrjs, Ajax, JSON, Angular 8, Type Script, Angular CLI , Node_rDOTrjs ,Express\nIDE s:Visual Studio Code, Sublime\nDebugging tools:Chrome Developer Tools.\nOperating systems: Mac OS, Windows.\nMobile Emulator:Android Studio\nVersion Control:GIT, SVN.\nDatabase:SQL Server , MongoDB\n\nPROJECT WORK\nDESIGN AND ANALYSIS OF PHASE LOCKED LOOP _rANDramp; MODELLLING ITS PERFORMANCE(MTECH PROJECT) :\nThis work is based on Phase Locked Loop(PLL) using Current Starved Inverter VCO in 350nm,180nm and     90nm CMOS Technologies and illustrates the design process of various blocks of the PLL. The PLL is a closed loop system that compares the phase of an output signal with an input reference signal. PLLs are widely used in order to generate well-timed on-chip clocks to be used in high performance digital systems.\nMini Project: - ADVANCED EMBEDED SYSTEM MOBILE (BTECH PROJECT).\n\nEXPERIENCE\nESSPL, Bhubaneswar, Odisha\nFRONT END DEVELOPER\n12/2020Present\n\nProject-1(Mobile App Developer-React Native)08/2022Present\nDesigned dynamic and multi-browser compatible pages using React Native and Java Script in Two Apps.\nImplemented Design, Functionality in Customer App for the User to Login, Logout, Register, Edit Profile, Reset Password of the User, Book the Shipments and Fetch and Calculate the total cost of the Shipments and Fetch the Address details and Confirm the Booking. Also Implemented Claim the Details of the Shipment, Track the Shipment.\nImplemented Design, Functionality in Driver App for the Driver to Login, Logout, Register, Edit Profile, Reset Password of the Driver, View the Route in Google Map and set the Destination location and Start the Trip and Stop the Trip and Record the Time and Scan Waybills and Take Picture and Take Digital Signature on Completion of Activity. Also Keeping Track of Problem Shipments and Auto Filling Weight details on Scanning Waybills and Calculate the Price of the