tails, salary details and their information in the form of reports.\n4. Admin module:  This module related to Administrators. Whatever they want to modify, they will do, Giving employee permissions to the application depending upon their role, removing the employee details whenever he left the company.\n\nResponsibilities:\n Going through System Requirement Document\n Designing the User Interface Part for Admin module.\n Creating stored procedures in sql server.  \n Worked extensively in designing and developing the User Interface \n Testing the products functionality\n\n\n\nEducational Qualification:\nBA from Palamuru University 63%. (2017)\nWorking Experience:\nWorking as a Software Developer With SSPL  from Dec 2017\nTo 2023\n\nProfessional Qualification:\nSkill: C, C_rPLUSr_rPLUSr, , C_rPOUNDr, NET, Asp _rDOTrnet core  2_rDOTr5 year, MVC  2_rDOTr5year,WEB API  2_rDOTr5 year .\n\nOperating Systems: Windows 98/2000/XP.\n\n\n\nDeclaration:\n\nI here by declare that the above mentioned information is correct to the best of my knowledge and I bear the responsibility for the correctness of the above mentioned particulars.\nDate: Place: \n(A MALLAIAH)', '2023-04-10 09:51:43', '2023-04-10 09:51:43', 0, 'site_1/0xxx/38722c2f1be6fcfc387be6af42a3579d/', '47d212f3bfed8107eb4b65f63e8940c3', 13, 'fc1cf4363b67d5e06890a5ee892d77ba'),
