he incidents without reaching the SLA.\nInvolved in to find the root cause analysis and close the tickets in Summit ticketing tool.  \nInvolved in creating stored procedures\nInvolved in creating reports and giving the report to end clients using Drill down and Drill through\n\nKey Achievements: \n I understood the software development life cycle of ASP_rDOTrNET MVC.\n I achieved working experience of Visual studio and web form applications.\n I understood and implemented the application to database connectivity using ADO_rDOTrNet and    Entity Framework', '2023-05-04 04:26:44', '2023-05-04 04:26:44', 0, 'site_1/0xxx/c06aa488c6cec53398d8c904986480a8/', '62c24d978669a9c3926212043902a72e', 25, '25d4cd357ffe91bb6a822001c57b150e'),
