(665, 671, 100, 1, 'Naukri_thirupathi[2y_0m]', 'Naukri_thirupathi[2y_0m].docx', 'Naukri_thirupathi[2y_0m].docx', '', 1, 'T. Thirupathi\nHyderabad, Telangana  \n\n_rPLUSr91-9542754625\n\n      thirupathi_rDOTrthumula59_rATrgmail_rDOTrcom\n\n\nLooking forward to work in a competitive professional environment on challenging assignments that shall yield the twin benefits of job satisfaction and steady paced professional growth.\nProfessional Summary\nWorking as an React Native Developer in Dhanush InfoTech Pvt Ltd, Hyderabad.\nHaving 2 years of experience in Incline Inventions Pvt. Ltd, Hyderabad as a Research Engineer.\nOver all 3 years of professional IT hands on experience in design, development and implementation of React Native applications and Image processing applications with MATLAB.\nWorked on different mobile applications in real-time implementation. \nHaving good knowledge in UI technologies like React Native, HTML, CSS, JavaScript, React JS. \nHighly motivated to learn and showed Strong leadership skills and proven ability to manage and motivate a team to achieve best results.\nHands on experience on tools like Visual Studio Code, MATLAB, PyCharm.\nSkills\n React Native  CSS  HTML  React JS  Git  Postman  Insomnia Web View  Async Storage  Firebase  IONIC  Image processing  MATLAB GUI  Python Basics\n\nEducation\n M-Tech-2020\n JNTUH College of Engineering Jagtial, Nachupally (Kondagattu), Telangana\n B-Tech-2016\n Vaagdevi Engineering College, Warangal, Telangana\nDiploma 2013\nGovt. Polytechnic Parakala, Warangal, Telangana \n\nExperience\nApril 2022  Till Date\nDHANUSH INFOTECH PVT LTD, Hyderabad\n\nApril 2020  march 2022\nINCLINE INVENTIONS PVT_rDOTrLTD, Hyderabad\n\nProject Details: \nAP BJP\nClient: BJP\nDescription: \nThe objective of the AP BJP Booth Committee Mobile App:\n1_rDOTrEnroll eligible Voters as a member of the party digitally\n2_rDOTrReduce the labor of double entry system in conventional paper and pen work\n3_rDOTrSend important notifications to Members\nWith this digital enrollment process, there is a quick response of enrollment and members can access Mobile App, receive regular updates about events, campaigns from the AP BJP team and get the opportunity to participate in local and national events.\nSAMACHARA BHARATI\nClient: Samachara Bharati\nDescription of the Project: \nThis application is news application, we are showing national news and we have a scenario to join friends and donate to this application.\nAP_MLC \nClient: BJP\nDescription of the Project: \nMLC APP used for registration of Graduate Members Booth wise with personal information, address, and their employment details. After registration, the user can be able to login, register new graduate voters and create activities.\nResponsibilities:\nContributed to application requirement analysis for achieving the specifications provided by the client.\nInvolved in developing the UI for the app using Text Views, Buttons, Check boxes, Alert dialogs, Action bar and spinners for various layouts.\nDeveloped detailed profile pages - caching images from API responses for quicker load times. Implemented a modular search component with real time filtering and auto-suggestions.\nRefactored the app\'s navigation from the ground up using React Navigation to replicate native interactions. Rebuilt from scratch major feature components to improve performance and clean up code.\nResponsible for adding margin properties to the custom style objects and the alignment of home menus and swipe bar iOS-Android native navigation (e_rDOTrg_rDOTr, react-native-navigation).\nPresenting the Information using visualization tools. \nDeployed application to the APK file.\nProposing solutions and strategies to business challenges. \nCollaborating with engineering and product development teams. \nAcademic Projects:\nPlant disease detection using neural network. \nHeart Disease Prediction Using Machine Learning.\n\nDeclaration: \n\nI hereby declare that all above information provided by me is correct to the best of my knowledge.\n\n\nPlace:\nDate: T_rDOTrTHIRUPATHI', '2023-05-29 07:54:58', '2023-05-29 07:54:58', 0, 'site_1/0xxx/ec65160e87ebf62048cbf264e0d30b09/', 'da7b455899f686d40db692233e910c38', 75, '26f7085a28f06e8f062dc0eb42e83558'),
