(671, 677, 100, 1, 'Naukri_NavneetLaxmi[4y_0m]', 'Naukri_NavneetLaxmi[4y_0m].docx', 'Naukri_NavneetLaxmi[4y_0m].docx', '', 1, 'Navneet Laxmi                                    \nEmail-id:  navneet_rDOTrlaxmi_rATrgmail_rDOTrcom \nMob No. :  _rPLUSr91 8810438740\n\nCAREER Objective\n        I am aiming for constant progress, both professionally and personally in my career path. I intend to work with a dynamic organization in a challenging work environment to make significant contribution to the organization.\n\nCORE QUALIFICATIONS\n\nCreated 7_rPLUSr fully functional applications for Android devices.\nI am competent professional having 4 years of experience with a demonstrated record and      focus upon quality, Involved in identifying best practice technologies, Tools, procedures and standards coupled with strong interpersonal skills.\nCreative problem solver, with a keen attention to detail and quality.\nTake initiative and motivation to serve client needs.\nExcellent verbal and written communications skills. \nAlways responsible for given assignment with efficiency.\n\n \nPROFESSIONAL EXPERIENCE\n\nTechMahindra                             : 1st June 2022  till date HYPERLINK \"https://www_rDOTrnaukri_rDOTrcom/samsung-r-d-institute-india-noida-sri-noida-overview-4661139\" \n[Client :- Samsung R_rANDramp;D India Noida (SRI-N)]                     : Software Engineer (Android)\n\nChetu Inc.             : 7th Dec 2020  03rd May 2022\nDesignation                                       : Software Engineer (Android)\n\nOmnist Tech Hub Pvt. Ltd.               : 15th Feb 2019 - 22th Oct 2020\nDesignation                                                       : Android developer\n\nManacle India Pvt. Ltd.                    : 22nd  Oct 2018  - 31st Jan 2019\nDesignation.                                             : Android developer\n\nSterco Digitex Pvt. Ltd                          : May 2018  Oct 2018\nDesignation                                          : SEO\n\nELOQUENCE Academy                                       : August 2014  June 2018\nDesignation                                                                     : Java trainer\n\n\n\nLIVE PROJECTS UNDERTAKEN \n\nSamsung Shealth Application (1st June 2022  till date)\n\nAs a team member, Integrated Measure on Watch module for samsung watch 4 to measure Body mass through watch when it is in contact with human wrist and Body height is provided into the watch. The input can also be provided through application on phone device after then application will directly opens up in the watch.\n\nWorked on Expendable Chart to display the average BMI of the selected period or date range. The average BMI is calculated on the basis of Body Weight, Skeletal weight and Body height recorded by user since Beginning date to till date of the Target Achievement for Body Composition module.\n\nWorked on the Tiles layout of the home page, First depth and second depth of Body composition model for the change update made for new version 6_rDOTr22 One UI Five Changes.\n\nAs a team member, worked on the Bar Chart integrated with toggle switch tab sub- module of the Body Composition module.\n\nWorked on learning of the access, TCs pass for code, creating CLs and pushing code and other professional usage of  Github. \n\nWorked on to resolving the issues related with Body Composition module registered by QA and Market VOC. Then creating CLs and pushing it on Github as fix for the issues.\n\n       \n\nPoint Of Sale retail Software Android application(12th April 2021  03rd May 2022 )\n\nIntegrated Netum Bar Code Scanner to retrieve the price amount of items when its bar code was scanned.\nIntegrated Star Printer to print Order bill, Receipt bill or Invoice.\nWorked on BLE Bluetooth connectivity.\nWorked on to analyse the Cash Track application on clover mini production device and  implemented it into our application along with backend team who created the required APIs.\nWorked on to analyse the Table _rANDramp; Dining application on clover Flex device. And have started implementing it into our application. Some functionality like Table creation, items move and claim Table are completed and others like payment functionality is under progress.\nWorked on to the functionality of Gift Card generation, amount addition, and payment along with backend team for APIs. \n\nIVR (Interactive Voice Response) Software Android Application (7th Dec 2020  10th April 2021)\n\nImplemented Twilio : Communication APIs for Internet Voice Calling to IVR.\nImplemented Twilio : SDK for Internet Voice Calling to IVR.\nHandled all case of calling functionality like ringing mode, connecting mode, hold mode, connection failure mode and disconnected mode etc.\n\nIntegrated Google Speech-To-Text API to convert IVR speech into text lively. This means retrieving the sentence as text while IVR is asking or saying something to the caller person.\nIntegrated Google Text-To-Speech API  to convert text into speech for giving response to IVR.\nCreated full-fledged UI for customer grievance reporting screen and calling screen. \n\n\n\nDO You Dare(Betting)  Android Application  (12th Dec - 6th May 2020):-\n  \nIt\'s 2nd phase of the app. The change request for new UI design and new functionality was collected as requirement. Developed the application featuring smooth UI design and functionality providing user, a bigger platform to Create bet, making friend list and creating more challenges.\n\nPunch In (Product based Android Application) (20th July - 6th May 2020) :-\n\nDeveloped app for android platform with five module which are :\nAttendance module : user friendly calendar based module where multiple punch in/out time, duration of working hrs and work status will be displayed based on date selection.\nLeave module: user gets current year holiday list, can apply for leave based on type of leaves, can view his pending, approved and rejected leave list.\nInvoice module: Accountant of the company can keep track of all cleared and uncleared invoices of company\'s projects and its milestones.\nSalary module: user can apply for his salary slip based on his choice of months and years.\nUpload Documents: User can upload documents the company required.   \n \n Development also focused on robustness of the App including edge cases,  usability and general reliability.\n\nSirca Parivar (Android Application) (Live on Play Store) :-\n\nCollected requirements from client and design and develop the application with focus on better UI experience for user, application performance and fixing bugs with reliability. It provides client better interaction with customers.\n\nDiscount Coupon Customer (Android Application) (Live on Play Store) :-\n\nDesigned UI of home page and other few pages of application.\n\nState Kraft Turbine (Android Application) (Implementation Phase) :-\n\nDesigned UI and developed app with all use case needed to be handled.\nThe main challenge of this app was to categories different farms and its turbine owned by different owner. Categorisation of farms was based on capacity of wind electricity produced by many turbines allocated to the farm. It also include the input to turn off/on the individual turbine through app by the employee. \n\nSSPL (Finance Management Android Application) (Live On Play Store) :-\n\nIt manages the transaction of finance for Business Co-ordinator and District co-ordinator of Banks.\n\nKEY STRENGTH\n\nSOFTWARE SKILLS\nArchitecture\n\nSkills in Android:        Android jetpack, Navigation component, Shared View Model,\n                                                               Data binding, Twilio SDK, Google Live Speech-To-Text, and \n                                                               Text-To-Speech, integration, Expandable List view, Retrofit, JSON\n                                                               Parsing, GitHub             \nProgramming:           Kotlin(Basic), Core Java, SQL database queries\nPlatform:                    Android\nTools:                          Android Studio \nDatabases:                    Room Database, MySQL\nOperating System:       Window\n\n\n\n \nTECHNICAL STRENGTHS\n\n Completed followings responsibilities to deliver the best in the Project Development.\n\nAs JAVA Trainer, lead many students on making of various project like :-\nInternet Banking\nOnline Reservation System\nAutomation system using swing.\nOnline Shopping\nOther various mini projects like searching.\n\nTaken training on html, Web Designing, SEO, java programming at HCL CDC Noida.\nAppreciated for the Best member of the team\n\n\n\nPROJECT IMPLEMENTATION SKILLS AND EXPERIENCE\nClear understanding of the Core Business logic.\nAble to efficiently interact with the customer for understanding their requirements and enhancements for the project.\nGathered all pertinent information to create reports for presentation on department objectives to manage at monthly measurement meeting.\n\n\nPERSONAL SKILLS\nExperience at coordinating between team members to achieve the customer requirements.\nQuick learner and team player with good leadership qualities_rDOTr\nHave good interpersonal, analytical _rANDramp; problem-solving skills with ability to meet tight deadlines and work under pressure_rDOTr\nGood communication and interaction skills.\nSelf-initiator and self-motivated.\nServiced Focused.\n\n\nEDUCATION QUALIFICATION\nMaster of Computer Applications (MCA) in year 2014 from Bharti Vidyapeeth New Delhi.\nGraduated BCA in Computer Application in the year 2010 from T_rDOTrM Bhagalpur University, Patna.\nHigher Secondary science from Kendriya Vidhyalaya N_rDOTrT_rDOTrP_rDOTrC Deeptinagar, Kahalgaon, Bhagalpur\nMatriculation from D_rDOTrA_rDOTrV public school, N_rDOTrT_rDOTrP_rDOTrC Deeptinagar, Kahalgaon, Bhagalpur.\n                                                \n                                                                                                                                