(45, 400, '2023-07-15 01:15:00', 'salman', 0, 762, 100, 1, '2023-07-10 07:44:58', '2023-07-10 07:44:58', 1, -1, '', 60, 0, 'admin@testdomain.com', 15, 0, 1264, 'gvbghfyfyutuy', 'L1', 'Place <em>some</em> <u>text</u> <strong>here nnvjkdfhvkj</strong>'),
(46, 400, '2023-07-10 01:00:00', 'hgvhjguy', 0, 763, 100, 1, '2023-07-10 09:07:41', '2023-07-10 09:07:41', 1, -1, '', 60, 0, 'admin@testdomain.com', 15, 0, 1264, 'bvhgfjh', 'L1', '<p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">nship between your thesis and the information in each paragraph. A working thesis functions like a seed from which your paper, and your ideas, will grow. The whole process is an organic onea natural progression from a seed to a full-blown paper where there are direct, familial relationships between all of the ideas in the paper.</p><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">The decision about what to put into your paragraphs begins with the germination of a seed of ideas; this germination process is better known as&nbsp;<a title=\"Brainstorming\" href=\"https://writingcenter.unc.edu/tips-and-tools/brainstorming/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">brainstorming</a>. There are many techniques for brainstorming; whichever one you choose, this stage of paragraph development cannot be skipped. Building paragraphs can be like building a skyscraper: there must be a well-planned foundation that supports what you are building. Any cracks, inconsistencies, or other corruptions of the foundation can cause your whole paper to crumble.</p><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">So, lets suppose that you have done some brainstorming to develop your thesis. What else should you keep in mind as you begin to create paragraphs?&nbsp;<strong>Every paragraph in a paper should be</strong>:</p><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 60px; list-style: none; padding: 0px; color: rgb(51, 51, 51); font-family: Roboto, Helvetica, Arial, sans-serfif; font-size: 14px;\"><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Unified</strong>: All of the sentences in a single paragraph should be related to a single controlling idea (often expressed in the topic sentence of the paragraph).</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Clearly related to the thesis</strong>: The sentences should all refe</li></ul>'),
(56, 400, '2023-07-13 01:00:00', 'gfhjgjhg', 0, 761, 100, 1, '2023-07-13 12:51:15', '2023-07-13 12:51:15', 1, -1, 'bvhj', 60, 0, 'admin@testdomain.com', 15, 0, 1267, 'bgvgh', 'L1', NULL),
(57, 400, '2023-07-15 01:00:00', 'ghfhu', 0, 761, 100, 1, '2023-07-13 13:00:09', '2023-07-13 13:00:09', 1, -1, 'bvbnv', 60, 0, 'admin@testdomain.com', 15, 0, 1267, 'bhghjghj', 'L1', NULL),
(55, 400, '2023-07-13 01:00:00', 'ghfgffg', 0, 761, 100, 1, '2023-07-13 12:34:36', '2023-07-13 12:34:36', 1, -1, '', 60, 0, 'admin@testdomain.com', 15, 0, 0, '', 'Se', NULL),
(53, 400, '2023-07-13 01:00:00', 'bxjhdcjh', 0, 764, 100, 1, '2023-07-13 11:17:58', '2023-07-13 11:17:58', 1, -1, 'jhxgjsg', 60, 0, 'admin@testdomain.com', 15, 0, 1264, 'hxgsj', 'L1', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 1.5; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">It is important to note that a paragraph does not have a minimum or maximum number of sentences that it must have to fit the definition of a paragraph. Some writers will opt to use very short paragraphs, while others will include dozens of sentences in their paragraphs. It is also important to know that most writers separate lines of dialogue into paragraphs, so if a character only speaks a single line, it will be its own paragraph.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 1.5; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">Keeping that in mind, there is a general agreement on the format of a standard paragraph, which especially applies to informational and argumentative or persuasive writing. A paragraph should be divided into three distinct sections that each serve a purpose to the paragraph as a whole.</p><ol style=\"margin-bottom: 10px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\"><li>Topic Sentence - The&nbsp;<span style=\"font-weight: 700;\">topic sentence</span>&nbsp;is the sentence that lays out a preview of what the paragraph will be about. Think of it as a preview of the paragraph. It puts the reader\'s mindset into the right place to digest the information.</li><li>Supporting Sentence - The&nbsp;<span style=\"font-weight: 700;\">supporting sentence</span>&nbsp;is the most important part of the paragraph and provides details to support the topic sentence. If the topic sentence is about frogs, then the details should be about frogs as well. This section can be longer or shorter depending on the content and the writer\'s preference.</li><li><a class=\"external\" href=\"https://study.com/learn/lesson/concluding-sentence.html\" style=\"color: rgb(23, 151, 177); cursor: pointer;\">Concluding Sentence</a>- The&nbsp;<span style=\"font-weight: 700;\">concluding sentence</span>&nbsp;wraps up the paragraph and ties back to the topic sentence. A conclusion could be a reiteration of the topic, an opinion based on the topic, or a way to wrap up the paragraph with a more&nbsp;<a class=\"external\" href=\"https://study.com/learn/lesson/general-specific-ideas-statement.html\" style=\"color: rgb(23, 151, 177); cursor: pointer;\">general statement</a>.</li></ol><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 1.5; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">The following paragraph is an example of a simple paragraph that follows the basic paragraph form.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 1.5; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\"><i>1</i>&nbsp;There are many different kinds of animals that live in China.&nbsp;<i>2</i>&nbsp;Tigers and leopards are animals that live in China\'s forests in the north.&nbsp;<i>2</i>&nbsp;In the jungles, monkeys swing in the trees, and elephants walk through the brush.&nbsp;<i>The cities in China are filled with millions of people</i>.&nbsp;<i>2</i>&nbsp;There are camels in the deserts in China that people use for transportation.&nbsp;<i>3</i>&nbsp;Lots of different kinds of animals make their home in China.</p><ul style=\"margin-bottom: 10px; list-style-position: inside; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\"><li>In the example paragraph, the topic sentence, labeled with a&nbsp;<i>1</i>, states the paragraph\'s main idea. The reader can rightfully assume that the content will have to do with animals in China.</li><li>The supporting sentences, indicated by the&nbsp;<i>2</i>, are separated into sentences that give more specific information about animals that live in China. Each detail directly supports the main topic.</li><li>The concluding sentence, indicated by&nbsp;<i>3</i>, restates the topic sentence in a slightly different way to help wrap up the paragraph.</li><li>The highlighted sentence in the paragraph is important to note because it is a detail that does not relate closely enough to the topic sentence to be included in the essay. While the sentence does mention China, it would be better placed under a paragraph about people in China or the cities of China.</li></ul><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 1.5; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">Along with the general format of a paragraph, two kinds of paragraphs bear mentioning. They are a brief paragraph and a piece paragraph. A&nbsp;<span style=\"font-weight: 700;\">brief paragraph</span>&nbsp;is fairly straightforward since it contains the definition in its name. A brief paragraph is a short paragraph generally consisting of less than ten sentences in total.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 1.5; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">A&nbsp;<span style=\"font-weight: 700;\">Piece paragraph</span>&nbsp;is actually an acronym that stands for different parts that the paragraph should contain.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 1.5; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">P - The&nbsp;<i>P</i>&nbsp;stands for the point or the statement that the paragraph is making. This is often the lead sentence.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 1.5; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">I - The&nbsp;<i>I</i>&nbsp;stands for the introduction, which is almost always presented at the beginning of the paragraph.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 1.5; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">E - The&nbsp;<i>E</i>&nbsp;stands for evidence which are sentences that back up the point.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 1.5; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">C - The&nbsp;<i>C</i>&nbsp;stands for citation, which tells the reader where the evidence comes from.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 1.5; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">E - The second&nbsp;<i>E</i>&nbsp;stands for the explanation, which is where the writer explains why it\'s important or what should be done etc.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 1.5; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">The PIECE paragraph is used almost exclusively for argumentative and expository writing.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 1.5; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\"></p><table border=\"0\" class=\"imageplugin isEven\" style=\"border-spacing: 0px; margin: 10px 0px 10px 10px; width: 437.156px; max-width: 50%; float: right; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\"><caption align=\"bottom\" style=\"padding-top: 8px; padding-bottom: 8px; color: rgb(85, 85, 85); font-size: 11.9px; font-style: italic; font-weight: 600;\"></caption></table>        '),
