(100, 400, '2023-07-18 01:00:00', 'email test', 0, 761, 100, 1, '2023-07-18 17:39:45', '2023-07-18 17:39:45', 1, -1, '', 60, 0, 'admin@testdomain.com', 15, 0, 1267, 'djhfjf', 'L3', '&lt;span style=&quot;color: rgb(85, 85, 85); font-family: &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px;&quot;&gt;While the format of paragraphs should be similar, the type of paragraph will differ greatly depending on the type of writing being done. There are four common types of paragraphs and do not include paragraphs to separate dialogue. The table below gives details about the four types.&lt;/span&gt;'),
(101, 400, '2023-07-18 01:00:00', 'Test email', 0, 761, 100, 1, '2023-07-18 18:55:27', '2023-07-18 18:55:27', 1, -1, '', 60, 0, 'admin@testdomain.com', 15, 0, 1267, 'hnxbsd', 'L3', '&lt;p style=&quot;line-height: 1.5; color: rgb(85, 85, 85); font-family: &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px;&quot;&gt;A&amp;nbsp;&lt;span style=&quot;font-weight: 700;&quot;&gt;Piece paragraph&lt;/span&gt;&amp;nbsp;is actually an acronym that stands for different parts that the paragraph should contain.&lt;/p&gt;&lt;p style=&quot;line-height: 1.5; color: rgb(85, 85, 85); font-family: &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px;&quot;&gt;P - The&amp;nbsp;&lt;i&gt;P&lt;/i&gt;&amp;nbsp;stands for the point or the statement that the paragraph is making. This is often the lead sentence.&lt;/p&gt;&lt;p style=&quot;line-height: 1.5; color: rgb(85, 85, 85); font-family: &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px;&quot;&gt;I - The&amp;nbsp;&lt;i&gt;I&lt;/i&gt;&amp;nbsp;stands for the introduction, which is almost always presented at the beginning of the paragraph.&lt;/p&gt;&lt;p style=&quot;line-height: 1.5; color: rgb(85, 85, 85); font-family: &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px;&quot;&gt;E - The&amp;nbsp;&lt;i&gt;E&lt;/i&gt;&amp;nbsp;stands for evidence which are sentences that back up the point.&lt;/p&gt;&lt;p style=&quot;line-height: 1.5; color: rgb(85, 85, 85); font-family: &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px;&quot;&gt;C - The&amp;nbsp;&lt;i&gt;C&lt;/i&gt;&amp;nbsp;stands for citation, which tells the reader where the evidence comes from.&lt;/p&gt;&lt;p style=&quot;line-height: 1.5; color: rgb(85, 85, 85); font-family: &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px;&quot;&gt;E - The second&amp;nbsp;&lt;i&gt;E&lt;/i&gt;&amp;nbsp;stands for the explanation, which is where the writer explains why it&#039;s important or what should be done etc.&lt;/p&gt;&lt;p style=&quot;line-height: 1.5; color: rgb(85, 85, 85); font-family: &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px;&quot;&gt;The PIECE paragraph is used almost exclusively for argumentative and expository&lt;/p&gt;'),
(102, 400, '2023-07-21 01:00:00', 'sufala', 0, 765, 100, 1, '2023-07-21 17:37:33', '2023-07-21 17:37:33', 1, -1, '', 60, 0, 'admin@testdomain.com', 15, 0, 1267, 'hgdgjadg', 'L2', '<h2 style=\"font-size: 26px; line-height: 40px; font-family: AkkuratPro, Arial, sans-serif; margin: 48px 0px 24px; color: rgb(43, 45, 56);\"><span style=\"font-weight: 400;\">How is a paragraph structured?&nbsp;</span></h2><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Before we dive into paragraph structure, lets start with paragraph meaning. A paragraph is an individual segment of writing that discusses a central idea, typically with more than one sentence. It even has its own paragraph symbol in copyediting, called the&nbsp;<i>pilcrow</i>&nbsp;(), not to be confused with the section symbol called the&nbsp;<i>silcrow</i>&nbsp;() thats common in legal code.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Here we focus mainly on paragraph structure, but feel free to read our&nbsp;<a href=\"https://www.grammarly.com/blog/paragraphs/\" target=\"_blank\" rel=\"noopener\" style=\"color: inherit; transition: all 0.2s ease 0s; border-bottom: 3px solid rgba(74, 110, 224, 0.25);\">ultimate guide to paragraphs</a>&nbsp;for more of the basics.&nbsp;</p><h3 style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: 700; font-stretch: normal; font-size: 21px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin: 40px 0px 16px; color: rgb(43, 45, 56);\"><span style=\"font-weight: 400;\">Parts of a paragraph</span></h3><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Like other forms of writing, paragraphs follow a standard three-part structure with a beginning, middle, and end. These parts are the&nbsp;<span style=\"font-weight: 700;\">topic sentence</span>,&nbsp;<span style=\"font-weight: 700;\">development and support</span>, and&nbsp;<span style=\"font-weight: 700;\">conclusion</span>.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\"><a href=\"https://www.grammarly.com/blog/topic-sentences/\" target=\"_blank\" rel=\"noopener\" style=\"color: inherit; transition: all 0.2s ease 0s; border-bottom: 3px solid rgba(74, 110, 224, 0.25);\"><span style=\"font-weight: 700;\">Topic sentences</span></a>, also known as paragraph leaders, introduce the main idea that the paragraph is about. They shouldnt reveal too much on their own, but rather prepare the reader for the rest of the paragraph by stating clearly what topic will be discussed.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">The&nbsp;<span style=\"font-weight: 700;\">development and support sentences</span>&nbsp;act as the body of the paragraph. Development sentences elaborate and explain the idea with details too specific for the topic sentence, while support sentences provide evidence, opinions, or other statements that back up or confirm the paragraphs main idea.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Last, the&nbsp;<span style=\"font-weight: 700;\">conclusion</span>&nbsp;wraps up the idea, sometimes summarizing whats been presented or transitioning to the next paragraph. The content of the conclusion depends on the type of paragraph, and its often acceptable to end a paragraph with a final piece of support that concludes the thought instead of a summary.&nbsp;</p><h3 style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: 700; font-stretch: normal; font-size: 21px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin: 40px 0px 16px; color: rgb(43, 45, 56);\"><span style=\"font-weight: 400;\">How many sentences are in a paragraph?</span></h3><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Most paragraphs contain between three and five sentences, but there are plenty of exceptions. Different types of paragraphs have different numbers of sentences, like those in narrative writing, in particular, where single-sentence paragraphs are common.</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Likewise, the number of sentences in a paragraph can change based on the style of the writer. Some authors prefer longer, more descriptive paragraphs, while other authors prefer shorter, faster-paced paragraphs.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">When it comes to nonfiction writing, like&nbsp;<a href=\"https://www.grammarly.com/blog/how-to-write-a-research-paper/\" target=\"_blank\" rel=\"noopener\" style=\"color: inherit; transition: all 0.2s ease 0s; border-bottom: 3px solid rgba(74, 110, 224, 0.25);\">research papers</a>&nbsp;or&nbsp;<a href=\"https://www.grammarly.com/blog/how-to-write-a-report/\" target=\"_blank\" rel=\"noopener\" style=\"color: inherit; transition: all 0.2s ease 0s; border-bottom: 3px solid rgba(74, 110, 224, 0.25);\">reports</a>, most paragraphs have at least three sentences: a topic sentence, a development/support sentence, and a conclusion sentence.&nbsp;</p><h3 style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: 700; font-stretch: normal; font-size: 21px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin: 40px 0px 16px; color: rgb(43, 45, 56);\"><span style=\"font-weight: 400;\">Types of paragraphs&nbsp;</span></h3><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Depending on the kind of writing youre doing, you may need to use different types of paragraphs. Heres a brief explanation of the common paragraph types most writing deals with.&nbsp;</p><ul style=\"margin-right: 0px; margin-bottom: 40px; margin-left: 0px; padding: 0px; list-style: none; color: rgb(59, 62, 77); font-family: AkkuratPro, Arial, sans-serif; font-size: 18px;\"><li aria-level=\"1\" style=\"letter-spacing: 0px; font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin: 0px 0px 16px; padding-left: 32px; list-style: none; text-indent: -32px;\"><span style=\"font-weight: 700;\">Expository:&nbsp;</span>Common in nonfiction and all&nbsp;<a href=\"https://www.grammarly.com/blog/types-of-essays/\" target=\"_blank\" rel=\"noopener\" style=\"color: inherit; transition: all 0.2s ease 0s; border-bottom: 3px solid rgba(74, 110, 224, 0.25);\">types of essays</a>, expository paragraphs revolve around explaining and discussing a single point or idea.&nbsp;</li><li aria-level=\"1\" style=\"letter-spacing: 0px; font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin: 0px 0px 16px; padding-left: 32px; list-style: none; text-indent: -32px;\"><span style=\"font-weight: 700;\">Persuasive:&nbsp;</span>Just like expository paragraphs, persuasive paragraphs focus on discussing a single point; however, they support opinions instead of facts.&nbsp;</li><li aria-level=\"1\" style=\"letter-spacing: 0px; font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin: 0px 0px 16px; padding-left: 32px; list-style: none; text-indent: -32px;\"><span style=\"font-weight: 700;\">Narrative:</span>&nbsp;When telling a story, a narrative paragraph explains an action or event. Each new sentence furthers or expands upon the action by providing new information.&nbsp;</li><li aria-level=\"1\" style=\"letter-spacing: 0px; font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin: 0px 0px 16px; padding-left: 32px; list-style: none; text-indent: -32px;\"><span style=\"font-weight: 700;\">Descriptive:&nbsp;</span>Also common in storytelling, descriptive paragraphs focus on describing a single topic, such as a person or an environment. Each new sentence adds a new detail about that topic.&nbsp;</li></ul><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">The type of paragraph used usually depends on the type of writing. For example, if youre writing a research paper, it would be difficult to justify a narrative paragraph.&nbsp;</p><h2 style=\"font-size: 26px; line-height: 40px; font-family: AkkuratPro, Arial, sans-serif; margin: 48px 0px 24px; color: rgb(43, 45, 56);\"><span style=\"font-weight: 400;\">Example paragraphs from literature&nbsp;</span></h2><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Rather than merely talk about paragraph structure, lets look at some paragraph examples so you can see structure in action.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">The first paragraph example comes from Bertrand Russell in his essay Icarus, or the Future of Science. This excerpt uses the same paragraph structure often used in research papers, essays, and other nonfiction writing. The first sentence makes a claim, and the subsequent sentences defend that claim, ending in a strong conclusion that ties everything together.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77); padding-left: 30px;\"><i>If men were rational in their conduct, that is to say, if they acted in the way most likely to bring about the ends that they deliberately desire, intelligence would be enough to make the world almost a paradise. In the main, what is in the long run advantageous to one man is also advantageous to another. But men are actuated by passions which distort their view; feeling an impulse to injure others, they persuade themselves that it is to their interest to do so. They will not, therefore, act in the way which is in fact to their own interest unless they are actuated by generous impulses which make them indifferent to their own interest. This is why the heart is as important as the head. By the heart I mean, for the moment, the sum-total of kindly impulses. Where they exist, science helps them to be effective; where they are absent, science only makes men more cleverly diabolic.</i></p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Notice how all sentences in the paragraph relate to the same idea: That humans act emotionally more than rationally. However, each sentence makes its own unique point, and when taken together, they connect to the central topic.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Another nonfiction paragraph example comes from&nbsp;<i>Twelve Years a Slave</i>, a memoir from freeborn African-American Solomon Northup who was kidnapped and forced into slavery for twelve years before friends and family intervened with the help of the law.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77); padding-left: 30px;\"><i>I expected to die. Though there was little in the prospect before me worth living for, the near approach of death appalled me. I thought I could have been resigned to yield up my life in the bosom of my family, but to expire in the midst of strangers, under such circumstances, was a bitter reflection.</i></p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Each sentence in this paragraph example relates to the feeling described in the topic sentence. Although writing in a narrative form, Northup waits until a new paragraph to continue the storythis paragraph focuses solely on that one emotion.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Finally, lets look at a fiction paragraph example. In Bram Stokers&nbsp;<i>Dracula</i>, one of the protagonists, Jonathan Harker, describes the appearance of Count Dracula.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77); padding-left: 30px;\"><i>His face was a stronga very strongaquiline, with high bridge of the thin nose and peculiarly arched nostrils; with lofty domed forehead, and hair growing scantily round the temples but profusely elsewhere. His eyebrows were very massive, almost meeting over the nose, and with bushy hair that seemed to curl in its own profusion. The mouth, so far as I could see it under the heavy&nbsp;<a href=\"https://www.grammarly.com/blog/mustache-moustache/\" style=\"color: inherit; transition: all 0.2s ease 0s; border-bottom: 3px solid rgba(74, 110, 224, 0.25);\">moustache</a>, was fixed and rather cruel-looking, with peculiarly sharp white teeth; these protruded over the lips, whose remarkable ruddiness showed astonishing vitality in a man of his years. For the rest, his ears were pale, and at the tops extremely pointed; the chin was broad and strong, and the cheeks firm though thin. The general effect was one of extraordinary pallor.</i></p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Paragraphs in fiction are more flexible with the rules, but nonetheless, this paragraph includes both a topic sentence and a concluding summary. Notice how all the details pertain to Draculas face and head; Stoker begins a new paragraph when describing other parts of his appearance, like his hands, because the author treats it as a separate topic.&nbsp;</p><h2 style=\"font-size: 26px; line-height: 40px; font-family: AkkuratPro, Arial, sans-serif; margin: 48px 0px 24px; color: rgb(43, 45, 56);\"><span style=\"font-weight: 400;\">How to write a paragraph&nbsp;</span></h2><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Paragraph structure isnt just for the benefit of readers, it also helps authors organize their thoughts and communicate clearly. Below we explain the different steps of how to write a paragraph, from the paragraph introduction all the way to the conclusion.</p><h3 style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: 700; font-stretch: normal; font-size: 21px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin: 40px 0px 16px; color: rgb(43, 45, 56);\"><span style=\"font-weight: 400;\">How to plan a paragraph</span></h3><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Before you begin writing a paragraph, look at how the paragraph fits into the writing as a whole. As mentioned above, different types of writing use different types of paragraphs, so make sure the paragraph type youre planning matches the context.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Ideally, youll already have an&nbsp;<a href=\"https://www.grammarly.com/blog/essay-outline/\" target=\"_blank\" rel=\"noopener\" style=\"color: inherit; transition: all 0.2s ease 0s; border-bottom: 3px solid rgba(74, 110, 224, 0.25);\">outline</a>&nbsp;for whatever youre writing, which will tell you what the paragraph is about and what to include. If not, your first step is to decide on the paragraph topic and which facts to include as support and development.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Keep in mind what comes before and after the paragraph so you can plan the right topic for the flow of your writing. Its jarring for the reader when the author jumps wildly from one topic to the next, so try to keep all related paragraphs together and in a logical sequence. If thats not possible, plan your topic sentence as a segue, perhaps using a&nbsp;<a href=\"https://www.grammarly.com/blog/transition-words-phrases/\" target=\"_blank\" rel=\"noopener\" style=\"color: inherit; transition: all 0.2s ease 0s; border-bottom: 3px solid rgba(74, 110, 224, 0.25);\">transition word</a>.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">It also helps to sketch out the parts of your paragraph: topic sentence, development and support, and conclusion. The more you prepare these parts now, the easier it will be to put them into words later.&nbsp;</p><h3 style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: 700; font-stretch: normal; font-size: 21px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin: 40px 0px 16px; color: rgb(43, 45, 56);\"><span style=\"font-weight: 400;\">How to start a paragraph</span></h3><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">Unless youre doing narrative writing, your paragraph introduction should always be the topic sentence. The trick is to avoid overexplainingsay only whats necessary. The goal of the topic sentence is to inform the reader what the paragraph is about; everything extra should be saved for the following sentences.&nbsp;</p><p style=\"font-size: 18px; line-height: 32px; font-family: AkkuratPro, Arial, sans-serif; margin-bottom: 16px; color: rgb(59, 62, 77);\">For example, in the&nbsp;<i>Twelve Years a Slave&nbsp;</i>paragraph sample, the topic sentence is only four words long. Northup saves the details fo</p>');
INSERT INTO `calendar_event` (`calendar_event_id`, `type`, `date`, `title`, `all_day`, `data_item_id`, `data_item_type`, `entered_by`, `date_created`, `date_modified`, `site_id`, `joborder_id`, `description`, `duration`, `reminder_enabled`, `reminder_email`, `reminder_time`, `public`, `interviewer_id`, `interview_link`, `interview_level`, `feedback`) VALUES
(103, 400, '2023-07-29 00:45:00', 'Interview with Beauty', 0, 766, 100, 1, '2023-07-24 10:28:22', '2023-07-24 11:02:36', 1, 0, 'Your Interview is scheduled', 60, 0, 'admin@testdomain.com', 15, 0, 1264, 'https://meet.google.com/apk-tfsj-xxh', 'L1', '                        <h2 style=\"color: rgb(0, 127, 174); font-family: Roboto; font-weight: 500; line-height: 1.1; margin-bottom: 14px; margin-top: 28px; font-size: 25px !important;\">BINI What is a paragraph?</h2><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">Paragraphs are the building blocks of papers. Many students define paragraphs in terms of length: a paragraph is a group of at least five sentences, a paragraph is half a page long, etc. In reality, though, the unity and coherence of ideas among sentences is what constitutes a paragraph. A paragraph is defined as a group of sentences or a single sentence that forms a unit (Lunsford and Connors 116). Length and appearance do not determine whether a section in a paper is a paragraph. For instance, in some styles of writing, particularly journalistic styles, a paragraph can be just one sentence long. Ultimately, a paragraph is a sentence or group of sentences that support one main idea. In this handout, we will refer to this as the controlling idea, because it controls what happens in the rest of the paragraph.</p><h2 style=\"color: rgb(0, 127, 174); font-family: Roboto; font-weight: 500; line-height: 1.1; margin-bottom: 14px; margin-top: 28px; font-size: 25px !important;\">How do I decide what to put in a paragraph?</h2><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">Before you can begin to determine what the composition of a particular paragraph will be, you must first decide on an&nbsp;<a title=\"argument\" href=\"https://writingcenter.unc.edu/tips-and-tools/argument/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">argument</a>&nbsp;and a working&nbsp;<a title=\"Thesis Statements\" href=\"https://writingcenter.unc.edu/tips-and-tools/thesis-statements/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">thesis statement</a>&nbsp;for your paper. What is the most important idea that you are trying to convey to your reader? The information in each paragraph must be related to that idea. In other words, your paragraphs should remind your reader that there is a recurrent relationship between your thesis and the information in each paragraph. A working thesis functions like a seed from which your paper, and your ideas, will grow. The whole process is an organic onea natural progression from a seed to a full-blown paper where there are direct, familial relationships between all of the ideas in the paper.</p><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">The decision about what to put into your paragraphs begins with the germination of a seed of ideas; this germination process is better known as&nbsp;<a title=\"Brainstorming\" href=\"https://writingcenter.unc.edu/tips-and-tools/brainstorming/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">brainstorming</a>. There are many techniques for brainstorming; whichever one you choose, this stage of paragraph development cannot be skipped. Building paragraphs can be like building a skyscraper: there must be a well-planned foundation that supports what you are building. Any cracks, inconsistencies, or other corruptions of the foundation can cause your whole paper to crumble.</p><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">So, lets suppose that you have done some brainstorming to develop your thesis. What else should you keep in mind as you begin to create paragraphs?&nbsp;<strong>Every paragraph in a paper should be</strong>:</p><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 60px; list-style: none; padding: 0px; color: rgb(51, 51, 51); font-family: Roboto, Helvetica, Arial, sans-serfif; font-size: 14px;\"><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Unified</strong>: All of the sentences in a single paragraph should be related to a single controlling idea (often expressed in the topic sentence of the paragraph).</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Clearly related to the thesis</strong>: The sentences should all refer to the central idea, or thesis, of the paper (Rosen and Behrens 119).</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Coherent</strong>: The sentences should be arranged in a logical manner and should follow a definite plan for development (Rosen and Behrens 119).</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Well-developed</strong>: Every idea discussed in the paragraph should be adequately explained and supported through evidence and details that work together to explain the paragraphs controlling idea (Rosen and Behrens 119).</li></ul><h2 style=\"color: rgb(0, 127, 174); font-family: Roboto; font-weight: 500; line-height: 1.1; margin-bottom: 14px; margin-top: 28px; font-size: 25px !important;\">How do I organize a paragraph?</h2><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">There are many different ways to organize a paragraph. The organization you choose will depend on the controlling idea of the paragraph.&nbsp;<strong>Below are a few possibilities for organization, with links to brief examples:</strong></p><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 60px; list-style: none; padding: 0px; color: rgb(51, 51, 51); font-family: Roboto, Helvetica, Arial, sans-serfif; font-size: 14px;\"><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Narration</strong>: Tell a story. Go chronologically, from start to finish. (<a title=\"Paragraph Development Examples\" href=\"https://writingcenter.unc.edu/tips-and-tools/paragraphs/paragraph-development-examples/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">See an example.</a>)</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Description</strong>: Provide specific details about what something looks, smells, tastes, sounds, or feels like. Organize spatially, in order of appearance, or by topic. (<a title=\"Paragraph Development Examples\" href=\"https://writingcenter.unc.edu/tips-and-tools/paragraphs/paragraph-development-examples/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">See an example.</a>)<img src=\"data:image/png;base64,');
