(106, 400, '2023-08-26 01:00:00', 'Testing Interview', 0, 767, 100, 1, '2023-07-26 12:10:51', '2023-07-26 12:10:51', 1, -1, 'Testing purpose', 60, 0, 'admin@testdomain.com', 15, 0, 1264, 'testingInterview', 'L2', '                <div class=\"page-header\" style=\"margin-top: 30px; margin-bottom: 30px; padding-bottom: 0px; color: rgb(51, 51, 51); font-family: Roboto, Helvetica, Arial, sans-serfif; font-size: 14px; border-bottom: none !important;\"><h1 style=\"font-size: 42px; margin-top: 28px; margin-bottom: 14px; color: rgb(0, 127, 174); font-family: &quot;Roboto Slab&quot;; line-height: 42px; letter-spacing: 1px;\">editeddd Paragraphs</h1></div><h2 style=\"color: rgb(0, 127, 174); font-family: Roboto; font-weight: 500; line-height: 1.1; margin-bottom: 14px; margin-top: 28px; font-size: 25px !important;\">What this handout is about</h2><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">This handout will help you understand how paragraphs are formed, how to develop stronger paragraphs, and how to completely and clearly express your ideas.</p><h2 style=\"color: rgb(0, 127, 174); font-family: Roboto; font-weight: 500; line-height: 1.1; margin-bottom: 14px; margin-top: 28px; font-size: 25px !important;\">What is a paragraph?</h2><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">Paragraphs are the building blocks of papers. Many students define paragraphs in terms of length: a paragraph is a group of at least five sentences, a paragraph is half a page long, etc. In reality, though, the unity and coherence of ideas among sentences is what constitutes a paragraph. A paragraph is defined as a group of sentences or a single sentence that forms a unit (Lunsford and Connors 116). Length and appearance do not determine whether a section in a paper is a paragraph. For instance, in some styles of writing, particularly journalistic styles, a paragraph can be just one sentence long. Ultimately, a paragraph is a sentence or group of sentences that support one main idea. In this handout, we will refer to this as the controlling idea, because it controls what happens in the rest of the paragraph.</p><h2 style=\"color: rgb(0, 127, 174); font-family: Roboto; font-weight: 500; line-height: 1.1; margin-bottom: 14px; margin-top: 28px; font-size: 25px !important;\">How do I decide what to put in a paragraph?</h2><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">Before you can begin to determine what the composition of a particular paragraph will be, you must first decide on an&nbsp;<a title=\"argument\" href=\"https://writingcenter.unc.edu/tips-and-tools/argument/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">argument</a>&nbsp;and a working&nbsp;<a title=\"Thesis Statements\" href=\"https://writingcenter.unc.edu/tips-and-tools/thesis-statements/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">thesis statement</a>&nbsp;for your paper. What is the most important idea that you are trying to convey to your reader? The information in each paragraph must be related to that idea. In other words, your paragraphs should remind your reader that there is a recurrent relationship between your thesis and the information in each paragraph. A working thesis functions like a seed from which your paper, and your ideas, will grow. The whole process is an organic onea natural progression from a seed to a full-blown paper where there are direct, familial relationships between all of the ideas in the paper.</p><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">The decision about what to put into your paragraphs begins with the germination of a seed of ideas; this germination process is better known as&nbsp;<a title=\"Brainstorming\" href=\"https://writingcenter.unc.edu/tips-and-tools/brainstorming/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">brainstorming</a>. There are many techniques for brainstorming; whichever one you choose, this stage of paragraph development cannot be skipped. Building paragraphs can be like building a skyscraper: there must be a well-planned foundation that supports what you are building. Any cracks, inconsistencies, or other corruptions of the foundation can cause your whole paper to crumble.</p><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">So, lets suppose that you have done some brainstorming to develop your thesis. What else should you keep in mind as you begin to create paragraphs?&nbsp;<strong>Every paragraph in a paper should be</strong>:</p><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 60px; list-style: none; padding: 0px; color: rgb(51, 51, 51); font-family: Roboto, Helvetica, Arial, sans-serfif; font-size: 14px;\"><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Unified</strong>: All of the sentences in a single paragraph should be related to a single controlling idea (often expressed in the topic sentence of the paragraph).</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Clearly related to the thesis</strong>: The sentences should all refer to the central idea, or thesis, of the paper (Rosen and Behrens 119).</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Coherent</strong>: The sentences should be arranged in a logical manner and should follow a definite plan for development (Rosen and Behrens 119).</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Well-developed</strong>: Every idea discussed in the paragraph should be adequately explained and supported through evidence and details that work together to explain the paragraphs controlling idea (Rosen and Behrens 119).</li></ul><h2 style=\"color: rgb(0, 127, 174); font-family: Roboto; font-weight: 500; line-height: 1.1; margin-bottom: 14px; margin-top: 28px; font-size: 25px !important;\">How do I organize a paragraph?</h2><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">There are many different ways to organize a paragraph. The organization you choose will depend on the controlling idea of the paragraph.&nbsp;<strong>Below are a few possibilities for organization, with links to brief examples:</strong></p><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 60px; list-style: none; padding: 0px; color: rgb(51, 51, 51); font-family: Roboto, Helvetica, Arial, sans-serfif; font-size: 14px;\"><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Narration</strong>: Tell a story. Go chronologically, from start to finish. (<a title=\"Paragraph Development Examples\" href=\"https://writingcenter.unc.edu/tips-and-tools/paragraphs/paragraph-development-examples/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">See an example.</a>)</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Description</strong>: Provide specific details about what something looks, smells, tastes, sounds, or feels like. Organize spatially, in order of appearance, or by topic. (<a title=\"Paragraph Development Examples\" href=\"https://writingcenter.unc.edu/tips-and-tools/paragraphs/paragraph-development-examples/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">See an example.</a>)</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Process</strong>: Explain how something works, step by step. Perhaps</li></ul>'),
