d-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">argument</a>&nbsp;and a working&nbsp;<a title=\"Thesis Statements\" href=\"https://writingcenter.unc.edu/tips-and-tools/thesis-statements/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">thesis statement</a>&nbsp;for your paper. What is the most important idea that you are trying to convey to your reader? The information in each paragraph must be related to that idea. In other words, your paragraphs should remind your reader that there is a recurrent relationship between your thesis and the information in each paragraph. A working thesis functions like a seed from which your paper, and your ideas, will grow. The whole process is an organic onea natural progression from a seed to a full-blown paper where there are direct, familial relationships between all of the ideas in the paper.</p><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">The decision about what to put into your paragraphs begins with the germination of a seed of ideas; this germination process is better known as&nbsp;<a title=\"Brainstorming\" href=\"https://writingcenter.unc.edu/tips-and-tools/brainstorming/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">brainstorming</a>. There are many techniques for brainstorming; whichever one you choose, this stage of paragraph development cannot be skipped. Building paragraphs can be like building a skyscraper: there must be a well-planned foundation that supports what you are building. Any cracks, inconsistencies, or other corruptions of the foundation can cause your whole paper to crumble.</p><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">So, lets suppose that you have done some brainstorming to develop your thesis. What else should you keep in mind as you begin to create paragraphs?&nbsp;<strong>Every paragraph in a paper should be</strong>:</p><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 60px; list-style: none; padding: 0px; color: rgb(51, 51, 51); font-family: Roboto, Helvetica, Arial, sans-serfif; font-size: 14px;\"><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Unified</strong>: All of the sentences in a single paragraph should be related to a single controlling idea (often expressed in the topic sentence of the paragraph).</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Clearly related to the thesis</strong>: The sentences should all refer to the central idea, or thesis, of the paper (Rosen and Behrens 119).</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Coherent</strong>: The sentences should be arranged in a logical manner and should follow a definite plan for development (Rosen and Behrens 119).</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Well-developed</strong>: Every idea discussed in the paragraph should be adequately explained and supported through evidence and details that work together to explain the paragraphs controlling idea (Rosen and Behrens 119).</li></ul><h2 style=\"color: rgb(0, 127, 174); font-family: Roboto; font-weight: 500; line-height: 1.1; margin-bottom: 14px; margin-top: 28px; font-size: 25px !important;\">How do I organize a paragraph?</h2><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">There are many different ways to organize a paragraph. The organization you choose will depend on the controlling idea of the paragraph.&nbsp;<strong>Below are a few possibilities for organization, with links to brief examples:</strong></p><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 60px; list-style: none; padding: 0px; color: rgb(51, 51, 51); font-family: Roboto, Helvetica, Arial, sans-serfif; font-size: 14px;\"><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Narration</strong>: Tell a story. Go chronologically, from start to finish. (<a title=\"Paragraph Development Examples\" href=\"https://writingcenter.unc.edu/tips-and-tools/paragraphs/paragraph-development-examples/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">See an example.</a>)</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Description</strong>: Provide specific details about what something looks, smells, tastes, sounds, or feels like. Organize spatially, in order of appearance, or by topic. (<a title=\"Paragraph Development Examples\" href=\"https://writingcenter.unc.edu/tips-and-tools/paragraphs/paragraph-development-examples/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">See an example.</a>)</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Process</strong>: Explain how something works, step by step. Perhaps follow a sequencefirst, second, third. (<a title=\"Paragraph Development Examples\" href=\"https://writingcenter.unc.edu/tips-and-tools/paragraphs/paragraph-development-examples/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">See an example.</a>)</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Classification</strong>: Separate into groups or explain the various parts of a topic. (<a title=\"Paragraph Development Examples\" href=\"https://writingcenter.unc.edu/tips-and-tools/paragraphs/paragraph-development-examples/\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 127, 174); text-decoration-line: underline; transition: all 0.3s ease-out 0s; text-shadow: none !important;\">See an example.</a>)</li><li style=\"padding-bottom: 0px; font-size: 14px; line-height: 21px;\"><strong>Illustration</strong>: Give examples and explain how those examples support your point. (See an example in the 5-step process below.)</li></ul><h2 style=\"color: rgb(0, 127, 174); font-family: Roboto; font-weight: 500; line-height: 1.1; margin-bottom: 14px; margin-top: 28px; font-size: 25px !important;\">Illustration paragraph: a 5-step example</h2><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">From the list above, lets choose illustration as our rhetorical purpose. Well walk through a 5-step process for building a paragraph that illustrates a point in an argument. For each step there is an explanation and example. Our example paragraph will be about human misconceptions of piranhas.</p><h3 style=\"color: rgb(66, 84, 99); font-family: Roboto; margin-bottom: 14px; margin-top: 28px; font-size: 21px;\">Step 1. Decide on a controlling idea and create a topic sentence</h3><p style=\"margin-bottom: 14px; font-size: 14px; line-height: 21px; font-family: Roboto, Helvetica, Arial, sans-serfif;\">Paragraph development begins with the formulation of the controlling idea. This idea directs the paragraphs development. Often, the controlling idea of a paragraph will appear in the form of a topic sentence.&nbsp;</p>'),
